create table citizen
(
    c_id             int auto_increment
        primary key,
    c_name           varchar(30)  not null,
    c_dob            date         not null,
    c_gender         varchar(1)   not null,
    c_medicalhistory varchar(200) null,
    c_vaccinated     int          not null,
    h_id             int          null,
    p_id             int          null,
    constraint citizen_ibfk_1
        foreign key (h_id) references health_care_centre (h_id)
            on update cascade on delete cascade,
    constraint citizen_ibfk_2
        foreign key (p_id) references health_ministry (e_id)
            on update cascade on delete cascade
);

create index h_id
    on citizen (h_id);

create index p_id
    on citizen (p_id);

